	cityList : [],
	hotCity : [ 11, 31, 4401, 4403, 5101, 50, 12, 3301, 3201, 3205, 4201, 6101 ],
	getCityList : function(){
		if(this.cityList.length>0)return this.cityList;
		var i=this.getDataLen()-1;
		this.cityList = [];
		for(;i>=0;i--){
			var data = this.dataList[i];
			if( this.isCity(data)){
				this.cityList.push(this.toObject(data));
			}
		}
		return this.cityList;
	},
	getHotCityList : function(){
		var hotCity = this.hotCity,
			i = 0,
			len = hotCity.length,
			ret = [];
		for(;i<len;i++){
			var city = this.getCityByCode(hotCity[i]);
			if(city){
				ret.push(city);
			}
		}
		return ret;
	},
	getAreaListByParentCode : function(parentCode,queryCity){
		if(queryCity && this.isMunicipalities(parentCode)){
			var city = this.getAreaByCode(parentCode);
			return [city];
		}
		var dataList = this.dataList,
			index = this.dataIndex,
			ret = [];
		for(var i=this.getDataLen()-1;i>=0;i--){
			var data = dataList[i];
			if(data[index.parentCode]==parentCode){
				ret.push(this.toObject(data));
			}
		}
		return ret;
	},
	getCityListByPhoneCode : function(phoneCode){
		if(!phoneCode || isNaN(parseInt(phoneCode))){
			return null;
		}
		var cityList = this.getCityList(),
			i=cityList.length-1,
			ret = [];
		for(;i>=0;i--){
			var data = cityList[i];
			if( data.phoneCode.indexOf(phoneCode)==0){
				ret.push(data);
			}
		}
		return ret;
	},
	getAreaByCode : function(code){
		var dataList = this.dataList,
			index = this.dataIndex;
		for(var i=this.getDataLen()-1;i>=0;i--){
			var data = dataList[i];
			if(data[index.code]==code){
				return this.toObject(data);
			}
		}
		return null;
	},
	getCityByCode : function(code){
		if(!code){
			return null;
		}
		var cityList = this.getCityList(),
			i=cityList.length-1;

		for(;i>=0;i--){
			var data = cityList[i];
			if( data.code==code){
				return data;
			}
		}
		return null;
	},
	getCityListByPinyin : function(pinyin){
		if(!pinyin){
			return null;
		}
		var cityList = this.getCityList(),
			i=cityList.length-1,
			ret = [];
		pinyin = pinyin.toLowerCase();
		for(;i>=0;i--){
			var data = cityList[i];
			if( data.pinyin.toLowerCase().indexOf(pinyin)==0){
				ret.push(data);
			}
		}
		return ret;
	},
	getCityListByName : function(name,length){
		if(!name){
			return null;
		}
		var cityList = this.getCityList(),
			i=cityList.length-1,
			ret = [],
			cnt = 0;
		length = length || 100000;
		for(;i>=0;i--){
			var data = cityList[i];
			if( data.name.indexOf(name)==0 || name.indexOf(data.name)==0){
				ret.push(data);
				cnt ++;
				if(cnt>=length)break;
			}
		}
		return ret;
	},
	getCityByName : function(name){
		var list =  this.getCityListByName(name,1);
		return list && list.length>0 ? list[0] : null;
	},
	groupCityByFirstLetter : function(){
		var cityList = this.getCityList(),
			i=0,len = cityList.length,
			clist = [],
			cityListByLetter = [],
			firstLetter = '',letter = '',letterIndex = [];
		cityList.sort(function(a,b){
			return a.pinyin.toLowerCase().charCodeAt(0) - b.pinyin.toLowerCase().charCodeAt(0);
		});
		//console.info(cityList);
		for(;i<len;i++){
			var city = cityList[i];
			firstLetter = city.pinyin.substring(0, 1).toUpperCase();
			if (letter!=firstLetter) {
				letterIndex.push(firstLetter);
			}
			if ('' != letter && firstLetter!=letter) {
				//console.info(cityListByLetter);
				clist.push({group:letter,label:letter,cityList:cityListByLetter});
				cityListByLetter = [];
			}
			cityListByLetter.push(city);
			letter = firstLetter;
		}
		if (cityListByLetter.length > 0){
			clist.push({group:letter,label:letter,cityList:cityListByLetter});
		}
		return clist;
	},
	isMunicipalities : function(code){
		var municipalities = this.municipalities,
			i = municipalities.length-1;
		for(;i>=0;i--){
			if(municipalities[i]==code)return true;
		}
		return false;
	},
	isCity : function(data){
		var index = this.dataIndex,
			code = data[index.code],
			cLen = code.length;
		return (cLen==2 && this.isMunicipalities(code) || cLen == 4 && !this.isMunicipalities(data[index.parentCode]));
	},
	getDataLen : function(){
		return this.dataLen || this.dataList.length;
	},

	toObject : function(arr){
		return {code:arr[0],name:arr[1],pinyin:arr[2],phoneCode:arr[3],parentCode:arr[4]};
	}

